import axios from "axios";
import React, { useState } from "react";


export default function Staffwork(){

    const [username,setUsername]=useState("");
    const [password,setPassword]=useState("");
    const [error, setError] = useState("");


    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
        const respone=await axios.post('http://localhost:8080/auth/register', { username, password });
        } catch (error) {
        setError(error.response.data.message);
        }
    };

    return(
        <div className="row justify-content-center">
            <form className="col-md-5" onSubmit={handleSubmit}>
                <div className="row justify-content-center">
                    <h5 className="text-center text break">Unesi novog zaposlenog</h5>
                </div>
                <div className="row justify-content-center">
                <label className="form-label my-1" htmlFor="username">Korisnicko ime:</label>
                    <input className="form-control" 
                        type="text" 
                        id="username" 
                        name="username"
                        value={username}
                        onChange={(e)=>setUsername(e.target.value)}
                        style={{borderRadius:'20px'}}></input>
                </div>
                <div className="row justify-content-center">
                <label className="form-label my-1" htmlFor="password">Korisnicko ime:</label>
                    <input className="form-control" 
                        type="text" 
                        id="password" 
                        name="password"
                        value={password}
                        onChange={(e)=>setPassword(e.target.value)}
                        style={{borderRadius:'20px'}}></input>
                </div>
                <div className="row justify-content-center my-3">
                    <button className="btn btn-primary" style={{width:"130px"}} type="subbmit"> Unesi </button>
                </div>
                <div className="row my-2">
                    <div className="col-md-12">
                        <p className="text-center text-break">{error && <span className="error" style={{color:"red"}}>Nije moguce uneti zaposlenog</span>}</p>
                    </div>
                 </div>
            </form>
        </div>
    );
}
